var tipuesearch = {"pages": [{'title': '每週編譯內容', 'text': '', 'tags': '', 'url': '每週編譯內容.html'}, {'title': 'week1', 'text': '建立cmsimde網站 \n 1. 2019Fall可攜套件.7z \n 2.在github下建立一個cd2020倉儲 \n 3.git clone https://github.com/s40723119/cd2020.git \n 4.如果CMSIMDE為空白，單獨git clone https://github.com/mdecourse/cmsimde.git \n 5.git submodule add  https://github.com/mdecourse/cmsimde.git \n 6.進入CMSIMDE，將up_dirup_dir內檔案複製到cd2020 \n 7.進入CMSIMDE，打python wsgi.py開始編輯網站 \n \n', 'tags': '', 'url': 'week1.html'}, {'title': 'week2', 'text': 'python3.8.2更新 \n 1.在 python官網 下載python3.8.2安裝包 \n 2.執行並點選Modify \n 3.將pip選項關閉 \n \n 4.下一步直到安裝完成 \n 5.更改啟動器路徑 \n \n 6.執行get-pip.py取得pip安裝軟件 \n 7.執行pip install依序下載以下模組\xa0 \xa0 \xa0 ex:pip install Markdown \n 有\xa0 Flask、 Markdown、 lxml、 bs4、 flask_cors、 pelican、 leo \n', 'tags': '', 'url': 'week2.html'}, {'title': 'week2.5', 'text': '1.第一次直播紀錄 \n \n', 'tags': '', 'url': 'week2.5.html'}, {'title': 'week3', 'text': '', 'tags': '', 'url': 'week3.html'}, {'title': 'week4', 'text': '分組討論及小組會議 \n 1. 分組討論-四輪機器人 \n 2. 小組會議紀錄', 'tags': '', 'url': 'week4.html'}, {'title': 'week5', 'text': '連假在家做口罩 \n', 'tags': '', 'url': 'week5.html'}, {'title': 'week6', 'text': '', 'tags': '', 'url': 'week6.html'}, {'title': 'week7', 'text': '', 'tags': '', 'url': 'week7.html'}, {'title': '分組討論-四輪機器人', 'text': 'CoppeliaSim簡介 \n 具有集成開發環境的機器人模擬器 CoppeliaSim 基於分佈式控制體系結構：可以通過嵌入式腳本，插件， ROS 節點， BlueZero 節點，遠程 API 客戶端或自定義解決方案分別控制每個對象 / 模型。這使 CoppeliaSim 非常通用，非常適合多機器人應用。控制器可以用 C / C ++ ， Python ， Java ， Lua ， Matlab ， Octave 或 Urbi 編寫。 \n CoppeliaSim應用程序列表 \n 1.工廠自動化系統仿真 \n 2.遠程監控 \n 3.硬件控制 \n 4.快速原型製作和驗證 \n 5.安全監控 \n 6.快速算法開發 \n 7.機器人相關教育 \n 產品介紹 \n CoppeliaSim可以用作獨立應用程序，也可以輕鬆地嵌入到主客戶端應用程序中：它的佔用空間小且精心設計的 API 使 CoppeliaSim 成為嵌入更高級別應用程序的理想選擇。集成的 Lua 腳本解釋器使 CoppeliaSim 成為了一種極其通用的應用程序，使用戶可以自由組合低級 / 高級功能以獲得新的高級功能。 \xa0 \n', 'tags': '', 'url': '分組討論-四輪機器人.html'}, {'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數.', 'tags': '', 'url': 'Develop.html'}]};